import React, {useEffect, useState} from "react";
import axios from "axios";

export default function Underwrite({employee}) {

    const [productIds, setProductIds] = useState(null);
    const [selectedProductId, setSelectedProductId] = useState(null);
    const [seniorRate, setSeniorRate] = useState('');
    const [maleRate, setMaleRate] = useState('');
    const [femaleRate, setFemaleRate] = useState('');
    const [occupationalHazardRate, setOccupationalHazardRate] = useState('');
    const [smokingRate, setSmokingRate] = useState('');


    useEffect(() => {
        axios.get('http://localhost:40055/api/product/unreleased')
            .then(response => {
                setProductIds(response.data);
                setSelectedProductId(response.data[0]);
            })
            .catch(error => {
                alert('시스템이 응답하지 않습니다, 잠시후 다시 시도해주세요.');
            });
    }, []);

    const handleSubmit = async (e) => {
        e.preventDefault();
        const productData = {
            id: selectedProductId,
            senior_rate: seniorRate,
            male_rate: maleRate,
            female_rate: femaleRate,
            occupational_hazard_rate: occupationalHazardRate,
            smoking_rate: smokingRate,
        };
        console.log(productData);
        await axios.post('http://localhost:40055/api/product/update', productData)
            .then(response => {
                if (response.data === false)
                    alert('요율 결정에 실패했습니다.');
                else {
                    alert('요율이 결정되어 상품이 공개 상태로 전환되었습니다.');
                }
            })
            .catch(error => {
                alert('시스템이 응답하지 않습니다, 잠시후 다시 시도해주세요.');
            });
    };

    const handelIdChange = (e) => {
        setSelectedProductId(e.target.value);
    };

    let selectProductIds = null;

    if (productIds !== null) {
        selectProductIds = productIds.map(productId =>
            <option value={productId}>
                {productId}
            </option>
        );
    }

    if (employee.department !== "UNDERWRITING") {
        alert("언더라이팅팀 직원만 접근 가능한 메뉴입니다.")
        return null;
    } else {
        return (
            <>
                <form onSubmit={handleSubmit}>
                    <div className="form">
                        <label htmlFor="id">상품 아이디</label>
                        <select onChange={handelIdChange}>
                            {selectProductIds}
                        </select>
                    </div>
                    <div className="form">
                        <label htmlFor="senior_rate">고령 요율</label>
                        <input type="text" id="senior_rate" name="senior_rate" value={seniorRate}
                               onChange={(e) => setSeniorRate(e.target.value)} required/>
                    </div>
                    <div className="form">
                        <label htmlFor="male_rate">남성 요율</label>
                        <input type="text" id="male_rate" name="male_rate" value={maleRate}
                               onChange={(e) => setMaleRate(e.target.value)} required/>
                    </div>
                    <div className="form">
                        <label htmlFor="female_rate">여성 요율</label>
                        <input type="text" id="female_rate" name="female_rate" value={femaleRate}
                               onChange={(e) => setFemaleRate(e.target.value)} required/>
                    </div>
                    <div className="form">
                        <label htmlFor="occupational_hazard_rate">위험 직업 요율</label>
                        <input type="text" id="occupational_hazard_rate" name="occupational_hazard_rate"
                               value={occupationalHazardRate}
                               onChange={(e) => setOccupationalHazardRate(e.target.value)} required/>
                    </div>
                    <div className="form">
                        <label htmlFor="smoking_rate">흡연 요율</label>
                        <input type="text" id="smoking_rate" name="smoking_rate" value={smokingRate}
                               onChange={(e) => setSmokingRate(e.target.value)} required/>
                    </div>
                    <button type="submit">제출</button>
                </form>
            </>
        );
    }

}
